import { useField } from "formik";

const Checkbox = ({children, ...props}) => {
    const [field, meta] = useField({...props});

    console.log(field);
    return (
        <div>
            <label>
                <input type="checkbox" {...field} {...props} />
                {children}
            </label>
            {
                meta.touched && meta.error ?
                <div>{meta.error}</div> :
                null
            }
        </div>
    );
};

export default Checkbox;
